class NotoficationData {  NotoficationData({      this.id,       this.titleEn,       this.titleAr,       this.bodyEn,       this.bodyAr,       this.payload,       this.isRead,       this.image,      this.userId,      this.createdAt,       this.updatedAt,});  NotoficationData.fromJson(dynamic json) {    id = json['id'];    titleEn = json['title_en'];    titleAr = json['title_ar'];    bodyEn = json['body_en'];    bodyAr = json['body_ar'];    payload = json['payload'];    isRead = json['is_read'];    image = json['image'];    userId = json['user_id'];    createdAt = json['created_at'];    updatedAt = json['updated_at'];  }  int ?id;  String? titleEn;  String? titleAr;  String ?bodyEn;  String ?bodyAr;  String ?image;  String? payload;  int? isRead;  int? userId;  String? createdAt;  String? updatedAt;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['title_en'] = titleEn;    map['title_ar'] = titleAr;    map['body_en'] = bodyEn;    map['body_ar'] = bodyAr;    map['payload'] = payload;    map['is_read'] = isRead;    map['user_id'] = userId;    map['image'] = image;    map['created_at'] = createdAt;    map['updated_at'] = updatedAt;    return map;  }}